INSERT INTO `v1_68aa4633cc2c9f52bb3a4b03fcb632f0837cc8e2262a901e4334ba3aa70da7e1` VALUES (0, 0, "2030/12/31 15:00:00", 1, 2, 118501, 118501, 0, 0, "2021/10/19 12:00:00", "かりん", "カリン", 1, 118501, 118501, 2.0, 37, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 787, 0, 0, 0, 0, 37, 450);
INSERT INTO `v1_68aa4633cc2c9f52bb3a4b03fcb632f0837cc8e2262a901e4334ba3aa70da7e1` VALUES (0, 0, "2030/12/31 15:00:00", 3, 2, 118601, 118601, 0, 0, "2024/08/10 21:00:00", "ねびあ", "ネビア", 1, 118601, 118601, 2.0, 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 826, 0, 0, 0, 0, 0, 450);
INSERT INTO `v1_68aa4633cc2c9f52bb3a4b03fcb632f0837cc8e2262a901e4334ba3aa70da7e1` VALUES (15, 0, "2030/12/31 15:00:00", 3, 2, 119001, 119001, 0, 0, "2021/11/03 19:00:00", "いお", "イオ（ノワール）", 0, 119001, 119001, 2.27, 7, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 714, 0, 0, 0, 0, 7, 450);
INSERT INTO `v1_68aa4633cc2c9f52bb3a4b03fcb632f0837cc8e2262a901e4334ba3aa70da7e1` VALUES (12, 0, "2030/12/31 15:00:00", 3, 2, 119101, 119101, 0, 0, "2021/11/16 12:00:00", "くうか", "クウカ（ノワール）", 0, 119101, 119101, 2.545, 26, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 143, 0, 0, 0, 0, 7, 450);
INSERT INTO `v1_68aa4633cc2c9f52bb3a4b03fcb632f0837cc8e2262a901e4334ba3aa70da7e1` VALUES (5, 0, "2030/12/31 15:00:00", 1, 1, 119201, 119201, 0, 0, "2023/09/19 15:00:00", "まひる", "マヒル（クリスマス）", 1, 119201, 119201, 2.19, 6, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 397, 0, 0, 0, 0, 6, 450);
INSERT INTO `v1_68aa4633cc2c9f52bb3a4b03fcb632f0837cc8e2262a901e4334ba3aa70da7e1` VALUES (6, 0, "2030/12/31 15:00:00", 3, 1, 119301, 119301, 0, 0, "2021/12/22 12:00:00", "りの", "リノ（クリスマス）", 0, 119301, 119301, 1.97, 8, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 762, 0, 0, 0, 0, 8, 450);
