INSERT INTO `v1_68aa4633cc2c9f52bb3a4b03fcb632f0837cc8e2262a901e4334ba3aa70da7e1` VALUES (6, 0, "2025/03/15 14:59:59", 3, 1, 120001, 120001, 0, 0, "2025/03/10 12:00:00", "しずる", "シズル（ノワール）", 1, 120001, 120001, 2.375, 5, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 190, 0, 0, 0, 0, 5, 450);
